import React from 'react'
import './SearchList.css'
import { FaSearch } from 'react-icons/fa';


function SearchList({TitleArray})
{
  return (
    <>
    <div className="Container_SearchList">
        {
            TitleArray.map(m=>{
                return <p 
                key={m}
                className='titleItem'>
                <FaSearch/>
                {m}
    
            </p>
            })
        }
        
    </div>

    </>
  )
}

export default SearchList
